import React from "react";
import { Card as CardBS, Row, Col } from "react-bootstrap";

import "./card.scss";

const Card = () => {
	return (
		<CardBS>
			<CardBS.Body>
				<Row>
					<Col xs={5} className="card-img">
						gol
					</Col>
					<Col xs={7} className="card-body">
						dsd
					</Col>
				</Row>
			</CardBS.Body>
		</CardBS>
	);
};

export default Card;
